description:
King Biscuit Flower Hour Presents: Deep Purple in Concert is a live album taken from a Deep Purple performance originally broadcast on the King Biscuit Flower Hour, released in July 1995. The concert was recorded at the Long Beach Arena on 27 February, 1976. [Also released as 'On the Wings of a Russian Foxbat']

